import ChatBot from "react-simple-chatbot";
import "./ChatBox.css";

function ChatBox() {
  return (
    <ChatBot
      steps={[
        {
          id: "1",
          message:
            "Oi, sou a DermaBot. Estou aqui para te ajudar.",
          trigger: "greeting",
        },
        {
          id: "skin-type",
          message:
            "Oi, sou a DermaBot. Estou aqui para te ajudar.",
          trigger: "skin-type-options",
        },
        {
          id: "2",
          options: [
            {
              value: 1,
              label: "Number 1",
              trigger: "4",
            },
            {
              value: 2,
              label: "Number 2",
              trigger: "3",
            },
            {
              value: 3,
              label: "Number 3",
              trigger: "3",
            },
          ],
        },
        {
          id: "3",
          message: "Wrong answer, try again.",
          trigger: "2",
        },
        {
          id: "4",
          message: "Awesome! You are a telepath!",
          end: true,
        },
      ]}
    />
  );
}

export default ChatBox;
